contracts/Exchanges.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface GameAsset { // 用得到的Function, 不要更改
    function getPrice() external returns(uint);
    function getOwner() external returns(address);
    function isAvailable() external returns(bool);
}

struct ChangeLog {
    uint256 timestamp;
    uint8 operation; // 操作类型："add":0, "remove":1, "modify":2
}

contract GameAssetExchanges{
    address deployer;
    mapping(address => address) public Assest;
    address[] public GameAssetAddress;
    uint last_transision = 0;
    ChangeLog[] logs;
    
    constructor() {
        deployer = msg.sender;
    }


    function getGameAssetsByIndex() public view returns(address[] memory){
        return GameAssetAddress;
    }


    

    function recordArrayChange(address sender, uint8 operation) private {
        // 操作类型應該是整數值（0, 1, 2）
        logs.push(ChangeLog(block.timestamp, operation));
    }

}

